import { useAuth0 } from "@auth0/auth0-react"
import Cookies from "universal-cookie"
import "./style.css"
import Request from "../../Request/index.jsx"
import {
	QuestionMarkCircleIcon,
	Cog6ToothIcon,
	ArrowLeftOnRectangleIcon,
	CreditCardIcon,
} from "@heroicons/react/24/outline"

const NavTray = ({ setSelectedMode, subscription }) => {
	const { logout } = useAuth0()
	const cookies = new Cookies()

	const clearCookies = async () => {
		cookies.remove("token")
		cookies.remove("userflow")
	}

	const handleCheckout = (e) => {
		const commandsRequest = new Request("stripe/create-checkout-session/", {
			method: "POST",
		})

		commandsRequest
			.then((response) => {
				window.location.href = response.data.url
			})
			.catch((err) => {
				console.log(err)
			})
	}

	const handleSubscription = () => {
		const commandsRequest = new Request("stripe/create-checkout-session/", {
			method: "POST",
			data: {
				subscription_type: "lifetime",
			},
		})

		commandsRequest
			.then((response) => {
				window.location.href = response.data.url
			})
			.catch((err) => {
				console.log(err)
			})
	}

	return (
		<div className='flex flex-col pb-6 text-[#F2F2F2] text-opacity-90 font-normal mt-auto w-full text-md'>
			<div className='border-t-[2px] border-[#2A1752] mb-4'></div>
			{!subscription.subscribed && (
				<div
					className='flex flex-row items-center nav-button'
					onClick={() => handleSubscription()}
				>
					<CreditCardIcon className='h-5 w-5' />
					<p className='ml-2'>Early Bird Special</p>
					<div className='ml-auto mr-3 bg-delilahSecondary rounded-lg px-2 py-1 mt-[3px]'>
						<p className='text-xs font-bold text-opacity-50 '>NEW</p>
					</div>
				</div>
			)}
			{/* <a href='https://www.delilah.ai/' target='_blank'>
				<div className='nav-button'>
					<QuestionMarkCircleIcon className='h-5 w-5' />
					<p className='ml-2'> Guides and FAQ</p>
				</div>
			</a> */}
			<div className='nav-button' onClick={() => setSelectedMode("settings")}>
				<Cog6ToothIcon className='h-5 w-5' />
				<p className='ml-2'>Settings</p>
			</div>
			<div
				className='nav-button'
				onClick={() => window.open("https://discord.gg/ft8pDPQtSM")}
			>
				<i className='fa-brands fa-discord'></i>
				<p className='ml-2'> Discord </p>
			</div>
			<div
				className='nav-button'
				onClick={() => {
					clearCookies().then(() =>
						logout({ returnTo: window.location.origin })
					)
				}}
			>
				<ArrowLeftOnRectangleIcon className='h-5 w-5' />
				<p className='ml-2'> Log Out </p>
			</div>
		</div>
	)
}

export default NavTray
